import Card from './Card'
import Data from './Data'
const List = () => {

const [allcards, setallcards] = useState(Data)

  return (
    <div className='list_css'>
        {
        allcarddata.map(card =>{
          return <Card 
          key={card.id}
          card={card}
          />
        })
      }
       
    </div>
  )
}

export default List
